/**
 * UserInfoVO Object
 */
export interface UserInfoVO {
    /**
     * UserId of logged-in member.
     */
    userId?: string;
    /**
     * TenantId of logged-in member.
     */
    tenantId?: string;
    /**
     * LastLoggedInDate of the logged-in member. Format - MM/dd/yyyy HH mm ss SSS
     */
    lastLoggedInDate?: string;
    /**
     * TenantEnrollmentId of the logged-in member.
     */
    tenantEnrollmentId?: string;
    /**
     * Preferred Language for the logged-in member.
     */
    language?: string;
}
